sourcesContent:
function getDiscountedPrice(price, dpercent) {
  return price - (price * dpercent) / 100;
}

function getTaxedPrice(price, dpercent) {
  const discountPrice = getDiscountPrice(price, dpercent);
  return discountPrice * 0.088;
}

function getTax(price, dpercent) {
  const discountPrice = getDiscountPrice(price, dpercent);
  const taxedPrice = getTaxedPrice(price, dpercent);
  return taxedPrice - discountPrice;
}

export { getDiscountedPrice, getTaxedPrice, getTax };
